function processIndicators(ind) {
  let indicatorData = {};

  ["Unemployment", "DXY", "Housing", "Yield", "SnP", "Industry", "VIX","News"].forEach(
    indicator => {
      indicatorData[indicator] = ind[indicator].map(([dt, val]) => {
        //parse date
        let s = dt.split("/");
        let newDate = new Date(s[2], s[0] - 1, s[1]);

        return {
          "date": newDate,
          "value": val
        };
      });
      indicatorData[indicator].sort(function (a, b) { return a.date.getTime() - b.date.getTime() });
    }
  )

  console.log(indicatorData);

  return function (indicator: string, date: Date) {
    let data = indicatorData[indicator];
    let i = data.findIndex(dt => dt.date.getTime() > date.getTime()) - 1
    if (typeof i === 'number' && i >= 0) {
      return data[i];
    }
  }
}

