export function sanitizeLeadingIndicator(id) {

  var format = [];

  if (id == 'Recessions') {
    leadingIndicators[id].forEach((val) => {
      format.push({ start: new Date(val[0]), end: new Date(val[1]) })
    })
  } else {
    leadingIndicators[id].forEach((val) => {
      format.push({ date: new Date(val[0]), value: val[1] })
    })
  }

  return format;
}